// redux/store.js
import { configureStore } from "@reduxjs/toolkit";
import cartReducer from "./Slices/cartSlice"; // Ensure correct import

export const store = configureStore({
  reducer: {
    cart: cartReducer, // Correctly assigned
  },
});
